import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './SignUp.css'; 

const DevSignUp = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    address: '',
    city: '',
    state: '',
    password: '',
    confirmPassword: '',
  });

  const states = ["Bizerte", "Tunis", "Sousse", "Nabeul", "Sfax"];

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Submitted Data:", formData);
  };

  return (
    <div className="signup-container">
      <h2 className="signup-title">Developer Sign Up</h2>
      <div className="signup-form">
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label className="signup-label">First Name :</label>
            <input
              type="text"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              className="signup-input"
              placeholder="Enter your first name"
              required
            />
          </div>
          <div className="form-group">
            <label className="signup-label">Last Name :</label>
            <input
              type="text"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              className="signup-input"
              placeholder="Enter your last name"
              required
            />
          </div>
          <div className="form-group">
            <label className="signup-label">Email :</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              className="signup-input"
              placeholder="Enter your email"
              required
            />
          </div>
          <div className="form-group">
            <label className="signup-label">Address :</label>
            <input
              type="text"
              name="address"
              value={formData.address}
              onChange={handleChange}
              className="signup-input"
              placeholder="Enter your address"
              required
            />
          </div>
          <div className="form-group">
            <label className="signup-label">City :</label>
            <input
              type="text"
              name="city"
              value={formData.city}
              onChange={handleChange}
              className="signup-input"
              placeholder="Enter your city"
              required
            />
          </div>
          <div className="form-group">
            <label className="signup-label">State :</label>
            <select
              name="state"
              value={formData.state}
              onChange={handleChange}
              className="signup-input"
              required
            >
              <option value="">Select a state</option>
              {states.map((state) => (
                <option key={state} value={state}>{state}</option>
              ))}
            </select>
          </div>
          <div className="form-group">
            <label className="signup-label">Password :</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              className="signup-input"
              placeholder="Enter your password"
              required
            />
          </div>
          <div className="form-group">
            <label className="signup-label">Confirm Password :</label>
            <input
              type="password"
              name="confirmPassword"
              value={formData.confirmPassword}
              onChange={handleChange}
              className="signup-input"
              placeholder="Confirm your password"
              required
            />
          </div>
          <div className="button-container">
            <button type="submit" className="signup-button">Register</button>
          </div>
        </form>
        <p>
          <a href="/signup-organization" onClick={() => navigate('/signup-organization')}>
            Need to sign up an organization?
          </a>
        </p>
      </div>
    </div>
  );
};

export default DevSignUp;
